import React from "react";
import img1 from '../img/img (1).png';
import img2 from '../img/img (5).png';
import "./styles/Process.css";

function Process() {
    return (
        <div className="process-container my-5">
            <h2 className="text-center mb-2">Instant Makeup Removal</h2>
            <p className="text-center tagline">~ Your Natural Beauty, Just a Click Away</p>
            
            <div className="steps-wrapper">
                <div className="step-item">
                    <div className="step-number">1</div>
                    <p className="step-text">Upload Your Photo</p>
                </div>

                <div className="step-item">
                    <div className="step-number">2</div>
                    <p className="step-text">Watch the Magic Happen</p>
                </div>

                <div className="step-item">
                    <div className="step-number">3</div>
                    <p className="step-text">Save & Share Your Natural Look</p>
                </div>
            </div>
        </div>
    );
}

export default Process;
